import React from "react";
import { useNavigate } from "react-router-dom";
import "./navbar.css";
import { FaSearch, FaUsers, FaChartBar, FaEnvelope, FaUserPlus, FaUserCircle } from "react-icons/fa";

const Navbar = () => {
  const navigate = useNavigate();

  const handleSearch = () => {
    console.log("Search clicked"); 
    // Implement search functionality
  };

  const handlePeople = () => {
    navigate("/people"); 
    // Redirects to People page
  };

  const handleReports = () => {
    navigate("/reports");
    // Redirects to Reports page
  };

  const handleMessages = () => {
    navigate("/messages");
    // Redirects to Messages inbox
  };

  const handleInvite = () => {
    navigate("/invite");
    // Redirects to Invite page/form
  };

  const handleProfile = () => {
    navigate("/profile");
    // Redirects to User Profile page
  };

  return (
    <nav className="navbar">
      {/* Left side: Logo */}
      <div className="nav-left">
        <img src="/images/zidio_development_logo.jpg" alt="Zidio Logo" className="logo" />
      </div>

      {/* Center: Icons */}
      <div className="nav-center">
        <FaSearch className="nav-icon" title="Search" onClick={handleSearch} />
        <FaUsers className="nav-icon" title="People" onClick={handlePeople} />
        <FaChartBar className="nav-icon" title="Reports" onClick={handleReports} />
        <FaEnvelope className="nav-icon" title="Messages" onClick={handleMessages} />
        <FaUserPlus className="nav-icon" title="Invite" onClick={handleInvite} />
      </div>

      {/* Right side: User Profile */}
      <div className="nav-right">
        <FaUserCircle className="user-icon" title="User Profile" onClick={handleProfile} />
      </div>
    </nav>
  );
};

export default Navbar;
